import React from 'react'
import "./program.css";
const Program = () => {
    return (
        <div className='programs' id='programs'>
            <div className="programs-header">
                <span>Explore our</span> <span>Programs</span>
                <span>to shape you</span>
            </div>
        </div>
    )
}
export default Program
